#include<stdio.h>

//fib #23602 (4932 digits): 
//23602 fibonacci, after it gets 'inf'

int main(){
	long double n = 0, first = 0, second = 1, next = 0, c = 0;
	scanf("%Lf", &n);
	for(c = 0; c < n; c++){
		if(c <= 1)
			next = c;
		else{
			next = first + second;
			first = second;
			second = next;
		}
		printf("%.0Lf\n", next);
	}
	return 0;
}
